  true,\n\t\"url\": null,\n\t\"notes\": \"<p>NNDSS - Table II. Spotted Fever Rickettsiosis
  to Syphilis - 2014.In this Table, all conditions with a 5-year average annual national
  total of more than or equals 1,000 cases but less than or equals 10,000 cases will
  be displayed (u00efu00bfu00bdu00efu00bfu00bdu00efu00bfu00bd 1,000 and u00efu00bfu00bdu00efu00bfu00bd_
  10,000). The Table includes total number of cases reported in the United States,
  by region and by states, in accordance with the current method of displaying MMWR
  data.  Data on United States exclude counts from US territories. Note:These are
  provisional cases of selected national notifiable diseases, from the National Notifiable
  Diseases Surveillance System (NNDSS). NNDSS data reported by the 50 states, New
  York City, the District of Columbia, and the U.S. territories are collated and published
  weekly as numbered tables printed in the back of the Morbidity and Mortality Weekly
  Report (MMWR). Cases reported by state health departments to CDC for weekly publication
  are provisional because of ongoing revision of information and delayed reporting.
  Case counts in this table are presented as they were published in the MMWR issues.
  Therefore, numbers listed in later MMWR weeks may reflect changes made to these
  counts as additional information becomes available.</p>n<p>Footnotes:C.N.M.I.: Commonwealth
  of Northern Mariana Islands. U: Unavailable.    -: No reported cases.    N: Not
  reportable.    NN: Not Nationally Notifiable    Cum: Cumulative year-to-date counts.
  \   Med: Median.    Max: Maximum.</p>n<ul>n<li>Case counts for reporting years 2013
  and 2014 are provisional and subject to change. For further information on interpretation
  of these data, see <a href=\"http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesSurveillanceData20100927.pdf\">http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesS...</a>.
  Data for TB are displayed in Table IV, which appears quarterly. </li>n</ul>n<p>u00efu00bfu00bdu00efu00bfu00bdu00efu00bfu00bd
  Illnesses with similar clinical presentation that result from Spotted fever group
  rickettsia infections are reported as Spotted fever rickettsiosis. Rocky Mountain
  spotted fever (RMSF) caused by Rickettsia rickettsii, is the most common and well-known
  spotted fever.More information on NNDSS is available at <a href=\"http://wwwn.cdc.gov/nndss/\">http://wwwn.cdc.gov/nndss/</a>.</p>n\",\n\t\"license_title\":
